/**
 * Main function for mountain traversal, inputs the y and x increments and determines how many obstacles are encountered
 * @param yincr y axis increment
 * @param xincr x axis increment
 * @returns amount of obstacles encountered
 */
function traverseMountain(yincr,xincr) {
    let x = 0;
    let y = 0;
    let treesEncountered = 0;

    while(mountain[y] ? mountain[y][x] ? true : true : false) {
        let encounter = mountain[y][x];
        if (encounter == "#"){
            treesEncountered++
        }
        x = x + xincr;
        y = y + yincr;
    }
    return treesEncountered
}

let firstSlope = traverseMountain(1,1);
let secondSlope = traverseMountain(1,3);
let thirdSlope = traverseMountain(1,5);
let fourthSlope = traverseMountain(1,7);
let fifthSlope = traverseMountain(2,1);
console.log(firstSlope)
console.log(secondSlope)
console.log(thirdSlope)
console.log(fourthSlope)
console.log(fifthSlope)

console.log(firstSlope * secondSlope * thirdSlope * fourthSlope * fifthSlope)